import React from 'react';
import './Qualification.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

class Qualification extends React.Component {
  // constructor(props) {
  //   super(props);
  // }

  render(){
  	return(
  		<div className="qualification-container">
  			<div className="tctfl main-title">
  				Qualification
  			</div>
        <ul className="timeline-content-container">
          <li>
            <div className="tctfl qualification-content">
            TOEIC (ETS), Feb. 2021, SCORE: 925
            </div>
          </li>
          <li>
            <div className="tctfl qualification-content">
            OPEN WATER DIVER (PADI), Feb. 2019
            </div>
          </li>
          <li>
            <BrowserRouter>
              <Switch>
                <Route exact path="/" component={page1} />
                <Route exact path="/page2" component={page2} />　//追加　URLで/page2を指定するとpage2を表示する
              </Switch>
            </BrowserRouter>
          </li>
        </ul>
  		</div>
  	);
  }
}

export default Qualification;
